```json
{
  "application": "Zeppelin",
  "software": [
    {
      "name": "Java",
      "path": "/usr/lib/jvm/jre-1.8.0/",
      "required": true
    },
    {
      "name": "Python",
      "path": "/usr/bin/python",
      "required": true
    },
    {
      "name": "Spark",
      "path": "${HOME}/spark-${SPARK_VERSION}",
      "version": "2.3.0-bin-hadoop2.7",
      "required": true
    },
    {
      "name": "Zeppelin",
      "path": "${HOME}/zeppelin-${ZEPPELIN_VERSION}-bin-all",
      "version": "0.8.2",
      "required": true
    },
    {
      "name": "Scala",
      "path": "${HOME}/scala-2.10.4",
      "required": false
    }
  ],
  "resource_requirements": {
    "nodes": {
      "type": "integer",
      "description": "Number of nodes required for the job.  Include one node for the head/management/master node.  For example, if you want 8 compute nodes to process data, specify 9 nodes below.  If including Zookeeper, include expected Zookeeper nodes.  For example, if you want 8 Hadoop compute nodes and 3 Zookeeper nodes, specify 12 nodes (1 master, 8 Hadoop, 3 Zookeeper).  Also take into account additional nodes needed for other services.",
      "default": null,
      "optional": true
    },
    "partition": {
      "type": "string",
      "description": "The partition to run the job on",
      "default": null,
      "optional": true
    },
    "queue": {
      "type": "string",
      "description": "The batch queue to run the job on",
      "default": null,
      "optional": true
    },
    "walltime": {
      "type": "string",
      "description": "The walltime for the job in seconds or HH:MM:SS",
      "default": null,
      "optional": true
    },
    "memory": {
      "type": "integer",
      "description": "The amount of memory to allocate per node in MB",
      "default": null,
      "optional": true
    }
  }
}
